import * as React from 'react';
import {Card, Page, Layout} from '@shopify/polaris';
import BaseService from "../../commons/services/BaseService";
import {useEffect, useState} from "react";
import {getListUser, IResListUser} from "../../api/User";
import './index.scss';

const ListUser: React.FC<any> = () => {

    const [listUser, setListUser] = useState<IResListUser[]>([]);

    const getUsers = async () => {
        const res = await getListUser('https://fakestoreapi.com/users?page=1&limit=12');
        if (res.status === 200) {
            setListUser(res.body);
        }
    }

    useEffect(() => {
        getUsers()
    }, []);

    return (
        <Page
            fullWidth
            title="List user"
            pagination={{
                hasPrevious: true,
                hasNext: true,
            }}
        >
            <div className={'container'}>
                {
                    listUser.map(value => {
                        return (
                            <Layout.Section secondary>
                                <Card title="Order details" sectioned>
                                    <p>View a summary of your order.</p>
                                </Card>
                            </Layout.Section>
                        )
                    })
                }
            </div>
        </Page>
    )
}

export default ListUser;
